import "./App.css";
import InputDisplay from "./components/input-display";
import Button from "./components/button";
import Row from "./components/row";

function App() {
  const btnValues = [
    ["C", "+-", "%", "/"],
    [7, 8, 9, "X"],
    [4, 5, 6, "-"],
    [1, 2, 3, "+"],
    [0, ".", "="],
  ];

  const total = 0;
  const input = []; // input stack

  const inputClick = () => {
    console.log("click");
  };

  const renderButtons = () => {
    let row = [];
    for (let i = 0; i < btnValues.length; i++) {
      row.push(
        <Row>
          {btnValues[i].forEach((btnValue) => {
            return <Button inputClick={inputClick}>btnValue</Button>;
          })}
        </Row>
      );
    }
    return row;
  };

  return (
    <div className="flex justify-center">
      <div className="w-[34rem] h-[41rem] border-double border-2 border-indigo-700 rounded px-2 py-2 [&>*]:py-1 bg-indigo-200">
        <InputDisplay total={total}></InputDisplay>

        <Row>
          <Button inputClick={inputClick}>C</Button>
          <Button inputClick={inputClick}>+-</Button>
          <Button inputClick={inputClick}>%</Button>
          <Button inputClick={inputClick}>/</Button>
        </Row>
        <Row>
          <Button inputClick={inputClick}>7</Button>
          <Button inputClick={inputClick}>8</Button>
          <Button inputClick={inputClick}>9</Button>
          <Button inputClick={inputClick}>X</Button>
        </Row>
        <Row>
          <Button>4</Button>
          <Button>5</Button>
          <Button>6</Button>
          <Button>-</Button>
        </Row>
        <Row>
          <Button>1</Button>
          <Button>2</Button>
          <Button>3</Button>
          <Button>+</Button>
        </Row>
        <Row>
          <Button>0</Button>
          <Button>.</Button>
          <Button halfWidth>=</Button>
        </Row>
      </div>
    </div>
  );
}

export default App;
